import React, { forwardRef } from 'react';

function CaraOSelloHistorial({props, ref}){
    <div
    id='a'
    className="historial-resultados"
    ref={ref}
    >
      <label>
        {props.histrial}
      </label>
    </div>
  };

export default forwardRef(CaraOSelloHistorial);
